<?php/** * Created by PhpStorm. * User: khaoula * Date: 1/12/2023 * Time: 2:33 PM */namespace App\Document;use Doctrine\ODM\MongoDB\Mapping\Annotations as ODM;/** @ODM\EmbeddedDocument */class Pet{    /** @ODM\Id */    private $id;    /** @ODM\Field(type="string") */    private $pseudo;    /** @ODM\Field(type="string") */    private $gender;    /** @ODM\Field(type="string") */    private $race;    /** @ODM\Field(type="string") */    private $color;    /** @ODM\Field(type="date") */    private $birthdate;    /** @ODM\Field(type="boolean") */    private $vaccinated;    /** @ODM\Field(type="string") */    private $description;    public function getId()    {        return $this->id;    }    public function getPseudo()    {        return $this->pseudo;    }    public function setPseudo($pseudo): string    {        Return $this->pseudo = $pseudo;    }    public function getGender()    {        return $this->gender;    }    public function setGender($gender): string    {        Return $this->gender = $gender;    }    public function getRace()    {        return $this->race;    }    public function setRace($race): void    {        $this->race = $race;    }    public function getColor()    {        return $this->color;    }    public function setColor($color): void    {        $this->color = $color;    }    public function getBirthdate()    {        return $this->birthdate;    }    public function setBirthdate($birthdate): void    {        $this->birthdate = $birthdate;    }    public function getVaccinated()    {        return $this->vaccinated;    }    public function setVaccinated($vaccinated): void    {        $this->vaccinated = $vaccinated;    }    public function getDescription()    {        return $this->description;    }    public function setDescription($description): void    {        $this->description = $description;    }//    /** @ODM\Field(type="file") *///    private $picture;}